import React, { Component } from "react";

class InputComponent extends React.Component {
  render() {
    return (
      <form>
        {this.props.items.map((item) => (
          <div>
            <input id={item.id} defaultValue={item.text} />
          </div>
        ))}
      </form>
    );
  }
}

export default InputComponent;
